import React from "react";

const SocialMedia = () => {
  return (
    <div>
      <a href="#">
        <i class="fab fa-twitter"></i>
      </a>
      <a href="https://www.linkedin.com/in/niels-de-visser-5b718412a/">
        <i class="fab fa-linkedin"></i>
      </a>
      <a href="https://github.com/VoltrefferNL/">
        <i class="fab fa-github"></i>
      </a>
      <a href="mailto:niels@devisser.tech">
        <i class="fas fa-envelope"></i>
      </a>
    </div>
  );
};

export default SocialMedia;
